dateFunc = () =>{
    const formatFixer = nom => {
        if(nom < 10)
            return "0" + nom;
        else
            return nom;
    };

    const stringDay = day => {
        let dayStr;
        switch(day){
            case 0: 
                dayStr = "Sunday"; 
                break;
            case 1:
                dayStr = "Monday";
                break;
            case 2:
                dayStr = "Tuesday";
                break;
            case 3:
                dayStr = "Wednesday";
                break;
            case 4:
                dayStr = "Thursday";
                break;
            case 5:
                dayStr = "Friday";
                break;
            case 6:
                dayStr = "Saturday";
                break;                       
        }
        return dayStr;
    };

    var d = new Date();
    yearN = d.getFullYear();
    monthN = formatFixer(d.getMonth() + 1);
    dateN = formatFixer(d.getDate());
    hourN = formatFixer(d.getHours());
    minN = formatFixer(d.getMinutes());
    secN = formatFixer(d.getSeconds());
    milSecN = d.getMilliseconds();
    dayWeekN = d.getDay();
    // if(hourN < 10){
    //     hourN = "0" + hourN;
    // }
    
    // if(minN < 10){
    //     minN = "0" + minN;
    // }

    // if (secN < 10){
    //     secN = "0" + (secN);
    // }

    newEl.innerHTML = dateN + " - " + monthN + " - " + yearN + "<br>" + stringDay(dayWeekN) + "<br>" + hourN + ":" + minN + ":" + secN;

    // console.log(yearN, monthN, dateN);
    let dateObj = {
        "year": yearN,
        "month": monthN,
        "date": dateN,
        "hour": hourN,
        "min": minN,
        "sec": secN,
        "milliSec": milSecN,
        "day": dayWeekN
    };

    return dateObj;
};

setInterval(dateFunc, 100);


